import React, { Component } from "react";
import ContactCard from "./ContactCard.jsx";
import contacts from "../contacts.js";

function createCard(contact)
{
    return(
        <ContactCard 
            key ={contact.id}
            id = {contact.id}
            name = {contact.name} 
            email = {contact.email} 
            tel = {contact.phone}
            img = {contact.imgURL} />
    )
}
function App()
{
    return(
    <div>
        <h1 className="heading">My Contacts</h1>
        
        {contacts.map(createCard)}
